import React from 'react';

const ProductList = ({ onAddToCart }) => {
  const products = [
    { id: 1, name: 'Beras Premium', price: 12000, stock: 100, image: 'path_to_image_1' },
    { id: 2, name: 'Beras Organik', price: 15000, stock: 50, image: 'path_to_image_2' },
    { id: 3, name: 'Beras Super', price: 10000, stock: 200, image: 'path_to_image_3' }
  ];

  return (
    <div className="row">
      {products.map((product) => (
        <div key={product.id} className="col-md-4 mb-3">
          <div className="card">
            <img src={product.image} alt={product.name} className="card-img-top" />
            <div className="card-body">
              <h5 className="card-title">{product.name}</h5>
              <p className="card-text">Harga: Rp {product.price}/kg</p>
              <p className="card-text">Stok: {product.stock} kg</p>
              <button className="btn btn-success w-100" onClick={() => onAddToCart(product)}>
                Tambah ke Keranjang
              </button>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ProductList;
